import Header from '../../components/main_page/header/Header';
import './admin_page.css';
import UserHomeLayout from '../../layout/UserHomeLayout';
import axios from 'axios';


import { LoadAllAdminData } from './LoadAllDataAdmin';


import React, { useState } from 'react';
import { useDispatch } from 'react-redux';

function AdminPage() {

    const [user, setUser] = useState({});

    const getStudentList = () => {
        return new Promise((resolve, reject) => {
            axios.get("http://localhost:8080/student/all")
            .then(response => resolve(response.data))
            .catch(error => reject(error))
        });
    }

    new Promise((resolve, reject) => {
        axios.get("http://localhost:8080/admin/find/" + sessionStorage.getItem("user"))
        .then
    })

    axios.get("http://localhost:8080/admin/find/" + sessionStorage.getItem("user")).then(response => {
        //useDispatch(setUser(response.data))
        setUser(response.data);
    })

    return (
        <div className="">
            <LoadAllAdminData />
            <Header
                user={user}
                type="ADMIN" />
            {/* <UserHomeLayout 
                    type="ADMIN" /> */}
        </div>
    );

}

export default AdminPage;
